# function to add padding for base64 decode if needed
def decode_base64(data):
    missing_padding = len(data) % 4
    if missing_padding:
        data += '=' * (4 - missing_padding)
    return base64.urlsafe_b64decode(data)

################# text preprocessing functions that were also used in model training #######################
def remove_hyperlink(word):
    return  re.sub(r"http\S+", "", word)

def to_lower(word):
    result = word.lower()
    return result

def remove_number(word):
    result = re.sub(r'\d+', '', word)
    return result

def remove_punctuation(word):
    result = word.translate(str.maketrans(dict.fromkeys(string.punctuation)))
    return result

def remove_whitespace(word):
    result = word.strip()
    return result

def replace_newline(word):
    return word.replace('\n','')

def clean_up_pipeline(sentence):
    cleaning_utils = [remove_hyperlink,
                      replace_newline,
                      to_lower,
                      remove_number,
                      remove_punctuation,remove_whitespace]
    for o in cleaning_utils:
        sentence = o(sentence)
    return sentence

def processMessages(service, messages, folder_name):
    # GCS bucket name
    BUCKET_NAME = "capmaildata"
    # Path to your service account key JSON file
    #service_account_path = 'C:\\Users\\nathan.johannigman\\OneDrive\\Purdue Grad Cert\\BigData\\capstone\\capstone.json'
    service_account_path = './capstone.json'

    # Set the GOOGLE_APPLICATION_CREDENTIALS environment variable
    os.environ['GOOGLE_APPLICATION_CREDENTIALS'] = service_account_path

    # Initialize the GCS client
    storage_client = storage.Client()
    bucket = storage_client.bucket(BUCKET_NAME)

    # Iterate through each message and write to GCS
    for message in messages:
        msg = service.users().messages().get(userId='me', id=message['id']).execute()
        simplified_msg = {
            "id": "",
            "from": "",
            "to": "",
            "subject": "",
            "enc_text_body": "",
            "enc_html_body": "",
            "preprocessed_body": "",
            "is_spam": "",
            "folder": folder_name
        }

        #create a simplified message with only the information we care about
        simplified_msg["id"] = msg["id"]

        for header in msg["payload"]["headers"]:
            if header["name"] == "From":
                simplified_msg["from"] = header["value"]
            
            if header["name"] == "To":
                simplified_msg["to"] = header["value"]
            
            if header["name"] == "Subject":
                simplified_msg["subject"] = header["value"]
        
        for part in msg["payload"]["parts"]:
            if part["mimeType"] == "text/plain":
                simplified_msg["enc_text_body"] = part["body"]["data"]

            if part["mimeType"] == "text/html":
                simplified_msg["enc_html_body"] = part["body"]["data"]

        # clean the email body using the same process that was used for model training
        decoded_body = decode_base64(simplified_msg["enc_text_body"])
        decoded_body = decoded_body.decode('utf-8', errors='ignore')
        simplified_msg["preprocessed_body"] = clean_up_pipeline(simplified_msg["subject"] + " " + decoded_body)

        #tokenize the body
        embed_size = 100 # how big is each word vector
        max_feature = 50000 # how many unique words to use (i.e num rows in embedding vector)
