def getmail(request):
    # Replace these values with your token and refresh token for GMail API
    TOKEN = ""
    REFRESH_TOKEN = ""
    CLIENT_ID = ""
    CLIENT_SECRET = ""

    # Create credentials object for Gmail
    creds = Credentials(
        token=TOKEN,
        refresh_token=REFRESH_TOKEN,
        token_uri="https://oauth2.googleapis.com/token",
        client_id=CLIENT_ID,
        client_secret=CLIENT_SECRET,
        scopes=["https://www.googleapis.com/auth/gmail.readonly"]
    )

    # Build the Gmail service
    service = build('gmail', 'v1', credentials=creds)

    # Get the list of messages in the spam folder
    results = service.users().messages().list(userId='me', labelIds=['SPAM']).execute()
    messages = results.get('messages', [])

    processMessages(service, messages, "spam")

    # Get the list of messages in the inbox
    results = service.users().messages().list(userId='me', labelIds=['INBOX']).execute()
    messages = results.get('messages', [])

    processMessages(service, messages, "inbox")

    return "success"
